import React, { Component } from 'react'
import axios from 'axios'

class GameRoom extends Component {
  constructor(){
    super()
    this.state = {
      room : ''
    }
  }
  render () {
    return (
      <div>
        {console.log(this.props.room[0])}
      </div>
    )
  }
}

export default GameRoom
